CREATE TABLE `curso` (
  `idCurso` int(5) NOT NULL,
  `nome` varchar(150) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `descricao` text CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `eixo` text CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
