  `mercadoTrabalho` text CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `planoCurso` varchar(200) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `ptd` varchar(50) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `matriz` varchar(50) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
