--
-- Extraindo dados da tabela `curso`
--

INSERT INTO `curso` (`idCurso`, `nome`, `descricao`, `eixo`, `descricaoEixo`, `mercadoTrabalho`, `planoCurso`, `ptd`, `matriz`, `coordernador`, `imagem`) VALUES
(1, 'Ensino Médio', 'O Ensino Médio segundo LDBArt. 35. O ensino médio, etapa final da educação básica, com duração mínima de três anos, terá como finalidades:I - a consolidação e o aprofundamento dos conhecimentos adquiridos no ensino fundamental, possibilitando o prosseguimento de estudos;II - a preparação básica para o trabalho e a cidadania do educando, para continuar aprendendo, de modo a ser capaz de se adaptar com flexibilidade a novas condições de ocupação ou aperfeiçoamento posteriores;III - o aprimoramento do educando como pessoa humana, incluindo a formação ética e o desenvolvimento da autonomia intelectual e do pensamento crítico;IV - a compreensão dos fundamentos científico-tecnológicos dos processos produtivos, relacionando a teoria com a prática, no ensino de cada disciplina.', '', '																												', '																												', '', '', '', 'Mariana Cristina S. Porto Santos', 'ensinoMedio.jpg'),
(2, 'Técnico em Administração', '', 'Gestão e Negócios', 'Adota postura ética na execução da rotina administrativa, na elaboração do planejamento da produção e materiais, recursos humanos, financeiros e mercadológicos. Realiza atividades de controles e auxilia nos processos de direção utilizando ferramentas da informática básica. Fomenta ideias e práticas empreendedoras.																												', 'Instituições, privadas e do terceiro setor.																												', 'administracao.pdf', '', 'administracao.pdf', 'Roberto Moreira Salina Fernandes', 'administracao.jpg'),
(3, 'Técnico em Edificações', '', 'Infraestrutura', '													Desenvolve e executa projetos. Planeja a execução, elabora orçamento e memorial descritivo. Supervisiona a realização de diferentes etapas do processo construtivo. Presta assistência técnica no estudo e desenvolvimento de projetos, pesquisas e controle tecnológico de materiais. Orienta e coordena serviços de manutenção de equipamentos e de instalações. Orienta na assistência técnica para compra, venda e utilização de produtos e equipamentos especializados.																												', '														Empresas públicas, privadas e do terceiro setor na Área de Construção Civil e interfaces; escritórios de projetos e de construção civil; canteiros de obras.																												', 'edificacoes.pdf', '', 'edificacoes.pdf', 'Leandro Porto Santos', 'edificacoes.jpg'),
(4, 'Técnico em Enfermagem', '', 'Ambiente e Saúde', '																					Atua na promoção, prevenção, recuperação e reabilitação dos processos saúde-doença. Colabora com o atendimento das necessidades de saúde do paciente/ cliente, família e comunidade, em todas as faixas etárias. Desenvolve ações de educação para o autocuidado, bem como de segurança no trabalho e de biossegurança nas ações de enfermagem. Promove ações de orientação e preparo do paciente para exames. Presta assistência de enfermagem a pacientes clínicos e cirúrgicos em qualquer fase do ciclo vital. Participa de uma equipe multiprofissional com visão crética e reflexiva, atuando de acordo com princípios éticos. Exerce ações de cidadania e de preservação ambiental.																												', '																					Instituições hospitalares, ambulatoriais, clínicas, empresas, serviços sociais, serviços de urgência, unidades básicas de saúde, Programa Saúde da Família, home care (domicílio) e instituições de longa permanência para idosos.																						', 'enfermagem.pdf', '', 'enfermagem.pdf', 'Silvania Perón de Oliveira', 'enfermagem.jpg'),
(6, 'Técnico em Informática Integrado ao Ensino Médio', '', 'Informação e Comunicação', '																																			O técnico em Informática desenvolve e opera sistemas, aplicações e interfaces gráficas. Monta estruturas de banco de dados e codifica programas. Projeta, implanta e realiza manutenção de sistemas e aplicações. Seleciona recursos de trabalho, linguagens de programação, ferramentas e metodologias para o desenvolvimento de sistemas.																																										', '																																			Instituições públicas, privadas e do terceiro setor que demandem sistemas computacionais, especialmente envolvendo programação de computadores.																																	', 'integrado.pdf', '', 'integrado.pdf', 'Rafael Anderson Cruz', 'integrado.jpg'),
(7, 'Técnico em Informática para Internet', '', 'Informação e Comunicação', 'Desenvolve e realiza manutenções em websites, portais na internet e intranet. Utiliza ferramentas de desenvolvimento de projetos para construir soluções que auxiliam o processo de criação de interfaces e aplicativos empregados no comércio e marketing eletrônicos.														', 'Instituições públicas, privadas e do terceiro setor que demandem programação de computadores para internet.														', 'informaticaInternet.pdf', '', 'informaticaInternet.pdf', 'Silvia Mara Frare Rodrigues', 'informaticaWeb.jpg'),
(8, 'Técnico em Marketing', '', 'Gestão e Negócios', 'Colabora na elaboração do plano de marketing da empresa, de acordo com seu ramo ou porte, e no planejamento e implementação de ações de vendas e de mercado. Executa tarefa de análise das vendas, preços e produtos. Operacionaliza as políticas de comunicação da empresa: fidelização de clientes, relação com fornecedores ou outras entidades. Operacionaliza políticas de apresentação dos produtos no ponto de venda. Executa o controle, estatísticas e operações de telemarketing. Participa na elaboração e na realizaçao de estudos de mercado, interpreta e aplica a legislação da área.														', 'Instituições públicas, privadas e do terceiro setor; comércio; empresas de consultoria e autônomo.														', 'marketing.pdf', '', 'marketing.pdf', 'Sidnei Antonio Pereira Filho', 'marketing.jpg'),
(9, 'Técnico em Quimica', '', 'Produção Industrial', 'O Técnico em Química é o profissional que executa ensaios físico-químicos, participa do desenvolvimento de produtos e de processos, supervisiona operação de processos químicos e operações unitárias de laboratório e de produção; opera equipamentos em conformidade com normas de qualidade, de biossegurança e de controle ambiental. Interpreta manuais, elabora documentação técnica rotineira e de registros legais.														', 'Indústrias farmacêuticas, químicas e de alimentos, instituições científicas e de pesquisa.														', 'quimica.pdf', '', 'quimica.pdf', 'Denise de Fátima Nogueira Paulino', 'quimica.jpg'),
(10, 'Técnico em Segurança do Trabalho', '', 'Segurança', 'O Técnico em Segurança do Trabalho é o profissional que elabora e implementa políticas de saúde e de segurança do trabalho (SST). Realiza auditorias, acompanhamento e avaliação na área. Identifica variáveis de controle de doenças, de qualidade e do meio ambiente. Desenvolve ações educativas na área de saúde e segurança do trabalho. Participa de perícias e fiscalizações e atua em processos de negociação. Participa da adoção de tecnologias e de processos de trabalho. Gerencia documentação de SST. Investiga, analisa acidentes e recomenda medidas para sua prevenção e controle.														', 'Empresas públicas e privadas, como indústrias, hospitais, empresas comerciais, mineradoras, de construção civil e Área rural.														', 'segurancaTrabalho.pdf', '', 'segurancaTrabalho.pdf', 'Edson Carlos Serrano', 'segurancaTrabalho.jpg'),
(11, 'Técnico em Secretariado', '', 'Gestão e Negócios', 'Assessora o executivo, em linguagem nacional e internacional, para subsidiá-lo na tomada de decisões, inclusive para o planejamento estratégico, tático, operacional e plano diretor. Exerce funções gerenciais; empreendedoras; práticas inovadoras; ações proativas; comprometido com a cultura organizacional; gerencia o fluxo de informações: produção documental física e eletrônica, conferência da documentação com ênfase no apoio é gestão organizacional. Domina aplicativos e internet na pesquisa, organização, elaboração, atualização e manutenção de dados.														', 'Instituições públicas, privadas, mistas e do terceiro setor: indústrias, prestadoras de serviços e comércio.														', 'secretariado.pdf', '', 'secretariado.pdf', 'Maria Luiza Bastos dos Santos', 'secretariado.jpg'),
(12, 'Técnico em Serviços Jurídicos', '', 'Gestão e Negócios', 'O Técnico em Jurídico é o profissional que cumpre as determinações legais e judiciais atribuídas aos cartórios oficiais e extrajudiciais, lavrando atos, autuando processos e procedendo aos registros cabéveis. Expede mandados, traslados, cartas precatórias e rogatórias e certidões. É responsável pelo gerenciamento e pelo arquivo de processos e de documentos judiciários em geral. Realiza diligências, tais como: citações, intimações, prisões e penhoras. Presta atendimento ao público, redigindo procurações, autenticando documentos. Coadjuva em audiências. Pode supervisionar uma equipe de serventuários.														', 'Empresas privadas e setor público														', 'servicosJuridicos.pdf', '', 'servicosJuridicos.pdf', 'Carlos César de Souza', 'juridicos.jpg'),
(13, 'Técnico em Manutenção e Suporte em Informática', '', 'Informação e Comunicação', 'Realiza manutenção preventiva e corretiva de equipamentos, identificando os componentes de um computador e suas funcionalidades. Instala e configura equipamentos e softwares de rede e avalia a necessidade de substituição ou mesmo sua atualização. Instala e configura programas utilitários, aplicativos e sistemas operacionais. Realiza procedimentos de backup e recuperação de dados.														', 'Instituições públicas, privadas e do terceiro setor que demandem suporte e manutenção de informática; prestação autônoma de serviços.														', 'manutencaoInformatica.pdf', '', 'manutencaoInformatica.pdf', 'Adriano Oliveira Castro', 'manutencaoInformatica.jpg');

