  `titulo` varchar(50) CHARACTER SET latin1 NOT NULL,
  `texto` text CHARACTER SET latin1 NOT NULL,
  `foto` varchar(48) CHARACTER SET latin1 NOT NULL
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

--
-- Extraindo dados da tabela `depoimento`
--

INSERT INTO `depoimento` (`idDepoimento`, `idCurso`, `nome`, `titulo`, `texto`, `foto`) VALUES
(1, 7, 'Jhonatan Araujo Mangolin', 'Teoria x Prática', 'Gostei muito de estudar na Etec, pois os professores intercalam aulas teóricas com aulas práticas tornando o curso mais interativo e interressante. As bases teóricas nos trazem o conhecimento que necessitamos para atuar na área profissional e as aulas práticas antecipa-nos com o que iremos lidar no mercado de trabalho.', 'zi1FE9AewqETer9Qv3uApU2Ci7dMeA.jpg'),
(3, 12, 'Pâmella Pinheiro Muniz', 'Professores Dinâmicos', 'O primeiro contato com o curso é encantador, é além daquilo que as pessoas normalmente imaginam. Com ele você adquire uma boa bagagem para ingressar na faculdade ou prestar concursos, garantindo que você possa ter a certeza de que é esse ramo que deseja seguir. É importante ressaltar que o curso ensina um pouco de cada um dos vários direitos existentes, além de oferecer vagas de estágio. \r\nOs professores possuem uma boa bagagem e um bom dinamismo ao explicar a matéria. ', 'ibA6Q4KAkuakC2EUiMp36LcAakE7PayU4aJnA7iH.jpg'),
(4, 4, 'Daniela P. Gazoli', 'Ensino de Qualidade', 'Quando escolhi este curso não tinha base sobre o que era enfermagem, no entanto o curso e os professores muito bem preparados contribuíram para uma formação de qualidade e hoje graças a Etec de Lins estou atuando na área em dois serviços públicos, sendo um estadual e um municipal. Agradeço ao ensino de qualidade e a todo o corpo docente', '4d9002585a1734ddf908f3a34cbf8a32.jpg'),
(5, 7, 'Geovana Theodoro', 'Ótimo Ensino', 'Conclui três cursos sendo eles: Ensino Médio, Técnico em Informática e por fim Técnico em Informática para Internet, agradeço ao corpo docente pelo ensino de qualidade e pela contribuição na minha vida escolar, graças a Etec de Lins hoje sou aluna de uma universidade estadual e carrego comigo uma bagagem de conhecimento único. Todos os professores estão muito bem preparado para lecionar, tendo um conhecimento abrangente. Agradeço a toda Etec de Lins pelo ótimo ensino.', 'je93gu7ire15ikz7c7aan9anm2uu4pxu.jpg'),
(6, 8, 'Camila Assis', 'Professores nota 10. Eu recomedo', 'Concluir o Técnico em Marketing da ETEC de Lins, foi uma das escolhas mais certas que eu já fiz. O curso, além de ter um amplo ramo para o mercado de trabalho, me proporcionou muitos pontos positivos para a vida pessoal. O marketing ajuda a desenvolver melhor as habilidades, em relação a fala, interpretação e relacionamento com o público. Posso dizer que devido ao curso conquistei uma vaga de emprego na qual eu desejava. O curso abre portas e tem como objetivo colocar o aluno no caminho para a conquista certa de clientes e satisfação do consumidor. Você que está no ramo de comércio e vendas em geral, o que fazer para atrair o público? O curso de Marketing te direciona para esta conquista.', 'z34E9Aewer9Qv3uU2Ci7dMeA.jpg'),
(7, 2, 'José Donizete de Aguiar', 'Conhecimento nunca é demais', 'Começei a atuar na produção da empresa há 13 anos. Etapa por etapa, cheguei à supervisão da Monodensidade. Sou técnico em eletrônica e, recentemente, fui aprovado no técnico em admnistração na Etec. Além das apostilas, reservo tempo aos livros de gestão (emprestados pela Etec) que me auxiliam a refletir sobre como melhorar o meu desempenho e da equipe.', ''),
(8, 3, 'Renato da Quinta', 'Valeu muito a pena ', 'A Etec de Lins, foi um ponto de virada na minha vida, o curso técnico em edificações abriu portas que eu não esperava e trouxe ótimas oportunidades no mercado de trabalho. Com apenas cinco meses de curso consegui minha primeira oportunidade na área da construção civil, na construção habitacional da CDHU, o aprendizado do curso conciliado com a vivência dentro de uma obra me trouxe uma bagagem enorme de conhecimento. Ao fim do curso, mudei para São Paulo e mais uma vez por ter em meu curricu¬um um curso técnico do nível da ETEC mais uma porta se abriu, consegui uma oportunidade de trabalho na LAR Construtora, uma grande empresa na área de obras rápidas. Hoje estou trabalhando nesta construtora e uso diariamente os conhecimentos que obtive no curso. Sou muito grato pela oportunidade que o Curso Técnico em Edificações da ETEC de Lins me ofereceu. Valeu muito a pena cada noite de aula. Hoje sou um profissional realizado graças a ETEC de Lins', '0s5bsSLl.jpg'),
(9, 5, 'Maria Fernanda Barbute', 'Excelentes professores', 'O curso é ótimo para quem está buscando a carreira bancária, contábil ou até mesmo abrir seu próprio negócio. O curso me ajudou a evoluir na empresa onde trabalho, escolher a profissão que devo seguir e o mais importante, me preparou  para o mercado de trabalho. A ETEC conta com excelentes professores, que me proporcionou mais que conhecimento, forneceu-me as ferramentas necessárias para o sucesso.', '8Qu3vqiE.jpg'),
(10, 8, 'Ricardo Gama', 'Abriu várias portas em minha vida', 'O curso de Marketing abriu várias portas em minha vida, portas para o conhecimento, pois aprendi muito sobre mercado, público alvo etc. Enquanto fazia o curso de Marketing na ETEC houve um processo seletivo na empresa onde eu trabalho e o fato de cursar Marketing foi primordial para que eu fosse selecionado, pois eu tinha conhecimento técnico sobre o assunto. Costumo dizer que minha entrevista foi como falar de futebol pois já tinha domínio de muitos termos técnicos, já fazia parte daquele mundo. Hoje aplico os conhecimentos aprendidos na Etec em meu emprego e o que vejo em meu emprego na faculdade, construindo cada vez mais conhecimento', '8NRZUQKP.jpg'),
(11, 11, 'Carol', 'Grade Curricular Fantástica', 'O curso técnico de secretariado foi uma experiência inesquecível para mim, em relação ao aprendizado intelectual e também ao meu próprio crescimento como ser humano. No entanto há uma frase que diz literalmente este processo de um ano e três meses que eu passei, sendo ela Secretariar é uma arte, essas palavras fazem jus a qualidade do curso e da profissão de secretariado, pois  o mesmo obtém uma grade curricular fantástica, em que fica explícito que com as matérias e a competência dos professores, em especial a coordenadora Suellen Maia tivemos a oportunidade de aprender a arte de entender e  lhe dar com a gestão de pessoas, de conhecer e aceitar  outra cultura sendo ela espanhola ou americana, a fim de incluir até o setor administrativo e a organização de eventos.\r\nNo entanto a arte em que estou referindo é aquela que você aprende a ser um agente facilitador não apenas nas grandes ou pequenas organizações, mas também na vida, em que acredito ser essencial para a construção do sucesso de um técnico de secretariado. A direção, a coordenação aos professores e a todos os funcionários desde a limpeza até a secretaria eu Carol, agradeço pela competência. Muito obrigada!', 'aRge34Hjuy2.jpg'),
(12, 2, 'Maike Zellerhoff', 'Diferencial Profissional', 'O curso técnico em Administração contribuiu com extremo potencial no meu desenvolvimento, proporcionando um imenso diferencial profissional e pessoal para minha vida. Penso que a vida é semelhante a uma “ESCADA”, pois a medida que vamos superando os desafios, alcançamos degraus superiores, e exponho isso pois sei que não é fácil, porém NADA é impossível. O técnico abriu minha mente e desejadas oportunidades de trabalho na minha área de atuação. Assim, não importa o que fazemos e sim como, o modo, a dedicação e desenvoltura de como fazemos!', ''),
(13, 2, 'Julio Prado', 'Minha vida mudou', 'Eu me formei no curso de Administração aproximadamente uns anos atrás. Deste então meu currículo e minha vida acadêmica mudaram, para melhor. Se não fosse pelo curso e também orientação dos mestres não estaria onde estou hoje. O curso me ensinou ver a vida com planejamento, com precisão. Tudo isso resultou em inúmeras conquistas para mim. Como por exemplo, escrever uma obra literária e entrar na universidade que almejava na época. Tudo mudou. Minha vida mudou. Eu mudei', 'jHyNbG5Gfdeq3.jpg'),
(14, 8, 'Leandro Hermon', 'Uma escolha de vida', 'Quem nunca se viu perdido em escolher qual carreira seguir? Eu era assim, até meus professores do colegial falar que me daria bem em marketing. Não tinha noção nenhuma sobre a área para arriscar uma graduação assim. Então me apresentaram o curso técnico de Marketing na ETEC de Lins. Foi a minha melhor decisão, tanto profissional quanto pessoal. Aprendi com professores maravilhosos e de grande conhecimento, me apaixonei pela área. Hoje vejo marketing em tudo, estou me graduando em Marketing e atuo na área comercial (Varejo) de uma grande empresa no ramo alimentício, graças aos conhecimentos adquiridos desde o meu primeiro passo na ETEC de Lins.', 'cVgsHy67Jnha1.jpg');

