(6, 'Rafael Hamamura', 'Especialista', 'rafael.hamamura@fatec.sp.gov.br', '', 'http://lattes.cnpq.br/5246753292156416', 'rafaelHamamura.jpg', 'Possui graduação em Engenharia de Computação pela UNILINS - Centro Universitário de Lins(2009) e Pós-graduação em Segurança de Redes de Computadores. Atualmente é Analista de Suporte e Gestão da Faculdade de Tecnologia de Lins. Tem experiência na área de Ciência da Computação, com ênfase em Metodologia e Técnicas da Computação.', 1),
(7, 'Alciano Gustavo Genovez de Oliveira', 'Especialista', 'alciano.oliveira@etec.sp.gov.br', '', 'http://lattes.cnpq.br/6950819954771755', '', 'Possui Graduação em Ciência da Computação pela UNILINS (2003), Especialista em Redes de Computadores pela ESAB (2014), Licenciado em Informática pelo Centro Estadual de Educação Tecnológica Paula Souza, CEETEPS (2010)', 1),
(8, 'Jurandir dos Santos Fidelis Junior', 'Especialista', 'jurandir_fidelis@yahoo.com.br', '', 'http://lattes.cnpq.br/2702168934154239', '', 'Possui licenciatura em Química pelo Instituto Superior de Educação Auxilium. É especialista em Educação para o Ensino Superior pelo Centro Universitário Salesiano Auxilium.', 1),
