(10, 'Diego Henrique Emygdio Lázaro', 'Especialista', 'diego.lazaro4@etec.sp.gov.br', '', 'http://lattes.cnpq.br/3299348024187820', 'diegoEmydgio.jpg', 'Possui graduação em Tecnologia em Analise de Sistemas pelo Centro Universitário de Lins (2008) e pós- graduação(nível especialização) em Engenharia de Componentes Utilizando Java pela Faculdades Integradas de Ourinhos (2010) e está cursando no IBILCE-UNESP- Mestrado em Ciências da Computação. Atualmente é docente do Centro Estadual de Educação Tecnológica Paula Souza. Tem experiência na área de Ciência da Computação, com ênfase em Sistemas de Informação, atuando principalmente nos seguintes temas: java, java para internet (js, jsp, jsf e jstl), java persistence (jpa), delphi, controle de horas trabalhadas, aplicações comerciais, engenharia de software e criação de componentes utilizando java.', 1),
(12, 'Carlos Lourenço Atanázio Trombini', 'Especialista', 'carlos.trombini@bol.com.br', '', 'http://lattes.cnpq.br/4437971396950362', '', 'Bacharel em Administração pela FACAC, Licenciado em Administração pela FATEC de São Paulo, Especialista em Gestão Empresarial com Ênfase em Marketing e Recursos Humanos pelo UNISALESIANO de Lins, Especialista em Gestão da Produção e Logística pelo IMBRAPE de Araçatuba e Mestrando em Meio Ambiente e Desenvolvimento Regional pela UNOESTE.', 1),
(13, 'Roberto Moreira Salina Fernandes', 'Licenciado', 'r_msf@yahoo.com.br', '', '', '', 'Técnico em Contabilidade pela escola John F. Kennedy, Bacharel em Administração de Empresa pela FACAC, Licenciado em Administração e Matemática pela FAL, MBA em Gestão Empresarial pela Unilins.', 1),
(14, 'Clícia Anelize Garcia de Freitas', 'Licenciada', 'cliciafreitas@hotmail.com', '', 'http://lattes.cnpq.br/8812046091283284', '', 'Possui Licenciatura em Ciências pela Faculdade de Filosofia Ciências e Letras de Presidente Venceslau (1997). Bacharel em Marketing pelo Centro Universitário de Lins (2008), cursando MBA em Comunicação e Marketing em Mídias Digitais pela Universidade Estácio de Sá.', 1),
(15, 'Denise de Fátima Nogueira Paulino', 'Graduada', 'denise.paulino@etec.sp.gov.br', '', 'http://lattes.cnpq.br/9897312534894620', '', 'Cursando Pós graduação em Educação Ambiental e Desenvolvimento Sustentável pela Faculdade Integrada AVM de Brasilia - polo Marília término 2015, Graduação em Licenciatura com Habilitação Plena em Química pela Faculdade auxilium de filosofia ciências e letras de lins (2003), Licenciatura em Arte pela UNIMES 2007, Pedagogia UNINOVE Universidade Nove de Julho Pólo Bauru ( 2012)', 1),
