(23, 'Rodrigo de Barros Pagano', 'Especialista', 'rodrigo.pagano@etec.sp.gov.br', '', 'http://lattes.cnpq.br/6195012469882423', '', 'Licenciatura Plena em Pedagogia, FALC – Faculdade da Aldeia de Carapicuíba, São Paulo-SP, 2013/2014.Pós-Graduação Lato Sensu (MBA) em Excelência em Gestão de Projetos e Processos Organizacionais - Cursando Pós-Graduação Lato Sensu (MBA) em Gestão Estratégica da Educação – Faculdade Véris/IBTA – Instituto Brasileiro de Tecnologia Avançada – Araraquara-SP, 2009/2010. Licenciatura para o Ensino Técnico – Programa Especial de Formação Pedagógica de Docentes para Educação Profissional em Nível Médio. SENAI/UNIMEP, Bauru-SP, 2003/ 2004. Pós-Graduação Lato Sensu em Administração de Empresas - Gestão Empresarial. UNIRP, São José do Rio Preto-SP, 1998/1999. Graduação em Tecnologia em Processamento de Dados, Faculdade de Informática de Lins. Fundação Paulista de Tecnologia e Educação, Lins-SP, 1993/1997.\r\n\"', 1),
