(25, 'Carla Baggio Laperuta Fróes', 'Mestre', 'carlabglf@adv.oabsp.org.br', '', 'http://lattes.cnpq.br/5384479795191462', '', 'Advogada formada pela Instituição Toledo de Ensino (ITE-BAURU/1998), Especialista em Direito Processual pela Universidade Anhanguera (UNIDERP/2012), Licenciada em Direito pelo Centro Estadual de Educação Tecnológica Paula Souza (CEETPS/2014), Mestre em Teoria do Direito e do Estado pelo Centro Universitário Eurípides de Marília (UNIVEM/2014), Licenciada em Pedagogia pela FALC (2015).', 1),
(26, 'Sandra Maria Rodrigues Vilardi', 'Especialista', '', '', 'http://lattes.cnpq.br/8063756437461857', '', 'Possui graduação em Educação Artística, Artes Visuais, Letras Português / Espanhol e cursa Pedagogia atualmente. Pos graduada em Línguas e Práticas Pedagógicas em Comunicação e Linguagem. Atuando nas escolas - PREVE Objetivo de Lins, como professora de Arte; no CEL Centro de Ensino de Línguas, no ensino de espanhol; no UNISALESIANO, no ensino de Metodologia do Ensino de Arte de 1º ao 9 ano, pelo curso de Pedagogia, como professora convidada pelo Parfor do CNP; no Centro Paula Souza de Lins. Atuou nas seguintes gradduações: FPTE Fundação Paulista de Tecnologia de Lins (Secretariado Executivo Bilíngue), UNIMEP (Turismo), FAL Faculdade Auxilium Filosofia Ciências e Letras ( curso de Letras). Com mais de 1000 horas em cursos de extensão universitária - língua espanhola- e segmento da terceira idade.Foi aprovada pelo MEC/INEP, através da avaliação de programas e planejamento de cursos, nas faculdades de: turismo, secretariado executivo e letras , sem nenhuma restrição.', 1),
