INSERT INTO `noticias` (`idNoticias`, `dataNoticias`, `tituloNoticias`, `corpoNoticias`, `fotoNoticias`, `idUsuarios`) VALUES
(10, '2016-06-17', 'Vem aí­...', 'Festa em comemora&ccedil;&atilde;o aos 10 anos de nossa querida Etec de Lins.\r\n<ul>\r\n<li>Pra&ccedil;a de aliementa&ccedil;&atilde;o</li>\r\n<li>Apresenta&ccedil;&otilde;es de dan&ccedil;as</li>\r\n<li>Shows ao vivo</li>\r\n</ul>\r\nE muito mais, venha nos prestigiar nesta data t&atilde;o especial para n&oacute;s.\r\n&nbsp\r\nVOC&Ecirc; &Eacute; NOSSO CONVIDADO.', 'Cartaz10Anos.jpg', 3),
(9, '2016-02-16', 'Pesquisa de Interesse P&uacute;blico', 'A ETEC de Lins est&aacute; planejando a abertura de um novo curso para a nossa cidade, para tanto estamos realizando uma pesquisa de interesse aberta ao p&uacute;blico. Abaixo tem um link, por favor acessem o mesmo e fa&ccedil;am o preenchimento dos campos, fiquem tranquilos, as informa&ccedil;&otilde;es s&oacute; ser&atilde;o acessadas pelos administradores da p&aacute;gina.&nbsp;', 'pesquisapublica.jpg', 3),
(8, '2016-02-26', 'Pesquisa INOVA', 'Pesquisa sobre interesse de participa&ccedil;&atilde;o em palestra que o agente INOVA da Etec de Lins pretende oferecer a nossa escola.&nbsp;', 'pesquisainova.jpg', 3),
(7, '2016-03-22', 'Aviso Importante Aos Alunos', 'A Etec de Lins vem por meio desta informar que neste feriado, nossa escola estar&aacute; passando por uma moderniza&ccedil;&atilde;o da sua rede el&eacute;trica, sendo assim, os nossos servi&ccedil;os on-line estar&atilde;o fora do ar, pois ser&aacute; efetuado o desligamento dos nossos servidores para preservar os mesmos. Os servi&ccedil;os que ficar&atilde;o temporariamente fora de servi&ccedil;o s&atilde;o o site da escola e o sistema escolar NSA. Sem mais, Dire&ccedil;&atilde;o da escola&nbsp;', 'lampada.jpg', 3),
(11, '2016-08-25', 'Empreendedor do Futuro 2016 – Caminhando para 4º edição!', 'O projeto “Empreendedor do Futuro” tem como principal ação a realização de um concurso de ideias de negócios, uma competição de empresas Startups com foco em Tecnologia e Inovação. Podem participar alunos de escolas de Nível Superior, Técnico e Profissionalizante, das cidades de Lins, Cafelândia, Marília, Bauru, Jaú, Garça, Araçatuba, Campinas e suas regiões. O objetivo do Projeto é fomentar o espírito empreendedor em jovens estudantes e graduados recentemente, como consequência despertar novas vocações no Município de Lins e região.\r\n<br><br>\r\nO concurso caminha para a sua quarta edição neste ano e tem conseguido mudar a realidade de jovens da cidade de Lins e região, além de contribuir, de maneira fundamental para disseminação da cultura empreendedora. Trata-se de um projeto que pelos cuidados na concepção, na operacionalização e no acompanhamento posterior, tem permitido bons resultados, com reflexos positivos para as marcas que o têm apoiado.\r\n<br><br>\r\nOs resultados das 3 edições são mais que satisfatórios. Tivemos no total 105 projetos inscritos, 59 projetos selecionados e apresentados e 12 projetos pré incubados no programa Hotel de Projetos da Incubadora de Empresas de Lins.\r\n<br><br>\r\nA 3º edição foi recorde de projetos inscritos e alcance de divulgação, atingindo alunos de instituições de ensino renomadas, como Unesp e Unicamp.\r\n<br><br>\r\nNeste ano, as ideias vencedoras serão premiadas com “Capital Semente”, aporte financeiro para os vencedores que se engajarem no Hotel de Projetos (programa de formação da Incubadora de Empresas). São R$ 3.000,00 para o classificado em 1º lugar, R$ 1.500,00 para o 2º lugar e R$ 1.000,00 para o 3º lugar.\r\n<br><br>\r\nAs inscrições para o Projeto Empreendedor do Futuro deverão ser realizadas até o dia 30 de setembro. Esse ano antes do fim das inscrições, os interessados terão a oportunidade de participar do Workshop de Modelagem de Negócio, onde colocarão suas ideias no papel e criarão seus modelos de negócios.\r\n<br><br>\r\nO workshop acontecerá no dia 17/09. Os inscritos e selecionados farão treinamento no período de 15 a 22 de outubro e apresentarão seus trabalhos em 27 de outubro, quando também serão anunciados os três grandes vencedores.\r\n<br><br>\r\nAs inscrições deverão ser realizadas pelo site www.empreendedordofuturo.org\r\n<br><br>\r\nRealização Adetec, Incubadora de Empresas, Fatec e ETEC.', 'empreendedorFuturo.jpg', 3),
(12, '2016-09-08', 'Robótica Virtual', 'Voc&ecirc; aluno dos cursos T&eacute;cnico em Inform&aacute;tica Integrado ao Ensino M&eacute;dio, T&eacute;cnico em Inform&aacute;tica para Internet e T&eacute;cnico em Manuten&ccedil;&atilde;o e Suporte em Inform&aacute;tica, venha participar desta batalha!\r\n<p>Maiores inform&ccedil;&otilde;es com os professores: Edson, Rafael Cruz e Adriano.</p>', 'robocode.jpg', 3),
(14, '2016-09-20', 'Senha Vestibular Unesp 2017 - Desconto aluno Escola Pública', 'Aten&ccedil;&atilde;o alunos do 3&ordm; ano do Ensino M&eacute;dio Regular e Integrado, procurem a Orientadora Educacional para pegar a senha que dar&aacute; a isen&ccedil;&atilde;o de 75% para alunos de escola p&uacute;blica\r\nA Unesp oferece isen&ccedil;&atilde;o para socioeconomicamente carentes e redu&ccedil;&atilde;o de 50%, pela Lei Estadual 12.782, ou 75%, esta para candidatos do &uacute;ltimo ano do ensino m&eacute;dio da rede p&uacute;blica paulista (cerca de 500 mil alunos). O prazo para os pedidos de isen&ccedil;&atilde;o e redu&ccedil;&atilde;o de 50% vai de 2 a 9 de setembro. Os candidatos com direito a 75% de redu&ccedil;&atilde;o dever&atilde;o procurar a dire&ccedil;&atilde;o de suas escolas para obterem a senha de acesso.', 'vestibular-unesp-2017-inscricao-cronograma-provas-1.jpeg', 10),
(16, '2017-03-10', 'Aluno da ETEC Lins é medalha de prata na Olimpíada de Física', 'Aluno do ensino m&eacute;dio da ETEC de Lins, Victor Felipe do Amaral, ganha medalha de prata em f&iacute;sica, em evento disputado a n&iacute;vel nacional, com mais de 500.000 participantes, em 2016.<br />Trata-se da Olimp&iacute;ada de F&iacute;sica das Escola P&uacute;blicas, OBFEP, que teve tamb&eacute;m a Etec de Lins, como polo da prova te&oacute;rica e experimental, onde os alunos responderam quest&otilde;es e realizaram solu&ccedil;&otilde;es pr&aacute;ticas.<br />Victor que objetiva um curso de en<span class=\"text_exposed_show\" style=\"display: inline; font-family: inherit;\">genharia, disse que a classifica&ccedil;&atilde;o &eacute; um privil&eacute;gio e que representa um incentivo grande para continuar. Ele tamb&eacute;m foi aprovado no vestibular da FUVEST em 2016, na &aacute;rea de exatas, com trainee.<br />Para que o aluno medalha de prata pudesse participar da prova a n&iacute;vel nacional foi necess&aacute;rio se classificar junto com outros alunos de uma seletiva na pr&oacute;pria escola.<br />Victor &eacute; um constante entusiasta pelos estudos, abrindo m&atilde;o inclusive de algumas divers&otilde;es para se dedicar ao conhecimento.<br />Ele tamb&eacute;m &eacute; um dos volunt&aacute;rios que monitora outros alunos na biblioteca da ETEC de Lins, sobre mat&eacute;rias exatas.<br />O evento de premia&ccedil;&atilde;o, dever&aacute; acontecer na cidade de S&atilde;o Paulo, em local e data a ser marcado.<br />Em seu site a Comiss&atilde;o da OBFEP parabeniza os participantes e os premiados em N&iacute;vel Nacional e Estadual, agradecendo a colabora&ccedil;&atilde;o de todos que tornaram poss&iacute;vel a realiza&ccedil;&atilde;o de mais uma edi&ccedil;&atilde;o da OBFEP.</span>\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: #1d2129;\">\r\n<strong>Foto:</strong> Nilson Erick\r\n</div>', '17157483_1775038282813867_2532833431838435976_o.jpg', 1),
(15, '2016-09-30', 'PARABÉNS AOS ALUNOS DESTAQUE', '<p>A ETEC de Lins, tem orgulho dos alunos escolhido como destaque.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'IMG_20160930_160249039[1].jpg', 10),
(19, '2017-08-28', 'Mini Curso de Photoshop', '<center><strong>Mini Curso de Photoshop</strong></center>\r\n    <br>\r\n    <p>\r\n        A Etec de Lins, por meio da sua coordenação pedagógica, estará oferecendo o Mini Curso de\r\n        Photoshop, este que terá início das aulas no dia 04/09.\r\n    </p>\r\n    <p>Inscrições e informações na coordenação pedagógica com a Lívia</p>', 'miniPhotoshop.jpg', 1),
(17, '2017-05-18', 'Mini Cursos com Inscrições Abertas', '<p>A Etec de Lins informa que j&aacute; est&atilde;o abertas as inscri&ccedil;&otilde;es para os Mini Cursos dos diversos eixos tecnol&oacute;gicos da institui&ccedil;&otilde;es aos seus alunos, onde para efetuar a sua inscri&ccedil;&atilde;o basta acessar o link: <a href=\"https://goo.gl/forms/Z4ExhsEt9Vxxdytf1\"> Clique aqui. </a></p>', 'minicursos-online-gratis-.jpg', 1),
(18, '2017-06-19', '2ª SIPAT - ETEC LINS', '<center><strong>PROGRAMAÇÃO</strong></center>\r\n<br/>\r\n<p>20/06 <br/>\r\n14h às 16h30min - Banca de orientações sobre DST AIDS - CTA Lins (Centro de Aconselhamento e Testagem) - responsável Enfª Juliana Ravagnani - Sala 12</p>\r\n<p>19h30min - Palestra - \"Atendimento de Primeiros Socorros\" - Enfª Patrícia Crivelaro e alunos da graduação. Sala 06 da Etec</p>\r\n<p>21/06<br/> \r\n11h - Palestra \"Prevenção de DST\" - alunos do 2 mód. Técnico em Enfermagem. Sala 12</p>\r\n<p>22/06<br/>\r\n14h - Palestra sobre Incêndio - Corpo de Bombeiros de Lins - Sala 12</p>\r\n<p>19h30min - Palestra \"Infarto Agudo do Miocárdio e seus fatores de risco\" \r\nDr. Affonso Penha Junior - Cardiologista Unimed Lins. - Sala 12</p>\r\n<p>23/06<br/>\r\n11h - Treinamento de utilização de extintor<p>\r\n', '2_sipat.jpeg', 1),
(20, '2017-09-26', 'VISITA A 11ª FEIRA USP E AS PROFISSÕES 2017', '<p>\r\nOs alunos do Ensino Médio e Informática Integrado ao Ensino Médio da ETEC DE LINS, visitaram no dia 26 de agosto a 11ª FEIRA DA USP um momento importante para a escolha profissional em que receberam informações sobre os cursos oferecidos, o vestibular, os conteúdos programáticos e as especializações de cada Unidade de Ensino.\r\n</p>', 'usp.jpg', 1),
(21, '2017-09-26', 'Participação na JORNADA DAS PROFISSÕES UNISALESIANO 2017', '<p>\r\nNo dia 29 de agosto os aluno do Ensino Médio e Informática Integrado ao Ensino Médio da ETEC DE LINS participaram da Jornada das profissões do UNISALESIANO DE LINS. Esse evento é uma grande oportunidade dos alunos  visualizarem as possibilidades de carreira e de estudo, visitando laboratórios e conversando com professores.\r\n\r\n</p>', 'salesiano.jpg', 1),
(24, '2017-10-02', 'WebSai 2017', '<a href=\"\" target=\"_blank\">\r\n  Clique aqui para realizar a WebSai 2017\r\n</a>', 'websai2017.png', 1),
