(68, '2018-03-22', 'Edward Snowden acusa NSA de tentar rastrear usuÃ¡rios de bitcoin', 'O bitcoin e as demais criptomoedas tÃªm na criptografia o seu principal trunfo, permitindo que transaÃ§Ãµes sejam feitas e verificadas e os envolvidos permaneÃ§am desconhecidos. Contudo, documentos revelados por Edward Snowden mostram que o Blockchain do bitcoin pode ser nÃ£o estar tÃ£o a salvo de â€œintromissÃµesâ€ quanto parece.\r\n\r\nSegundo o ex-agente estadunidense, a AgÃªncia Nacional de SeguranÃ§a dos Estados Unidos (NSA) teria tentado rastrear os usuÃ¡rios da criptomoeda mais famosa do mundo ainda em 2013. Em longa reportagem publicada no site The Intercept, o processo Ã© descrito e ressalta todos os diversos esforÃ§os das autoridades dos Estados Unidos para identificar pessoas envolvidas em negociaÃ§Ãµes com bitcoins.\r\n\r\nConforme memorandos da NSA de cinco anos atrÃ¡s, a agÃªncia teria buscado essa identificaÃ§Ã£o em carÃ¡ter de urgÃªncia e mirado todo o mercado de criptomoedas, mas com prioridade para o bitcoin. Os documentos obtidos por Snowden indicam que nÃ£o apenas o Blockchain foi minuciosamente avaliado pelos agentes de inteligÃªncia dos EUA, mas tambÃ©m dados dos envolvidos e histÃ³rico de suas atividades na web, e atÃ© mesmo o endereÃ§o MAC de suas mÃ¡quinas foram coletados.', '15217392225ab3e5d6c7984.jpg', 1),
