(11, '2016-08-01', 'Processo Seletivo de Docentes 148/04/2016 â€“ Aviso de Resultado da Aula Teste e ClassificaÃ§Ã£o Fin', '<p><strong>ETEC DE LINS, Lins</strong></p>\r\n<p><strong>PROCESSO SELETIVO DE DOCENTES, NOS TERMOS DO COMUNICADO CEETEPS N&deg; 1/2009, E SUAS ALTERA&Ccedil;&Otilde;ES.</strong></p>\r\n<p><strong>AVISO N&deg; 148/04/2016 de 09/06/2016. Processo n&deg; 4395/2016</strong></p>\r\n<p style=\"text-align: center;\"><strong>AVISO DE RESULTADO DA AULA TESTE E CLASSIFICA&Ccedil;&Atilde;O FINAL</strong></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">O Diretor de Escola T&eacute;cnica da ETEC DE LINS, faz saber aos candidatos abaixo relacionados o resultado da AULA TESTE e CLASSIFICA&Ccedil;&Atilde;O FINAL.</p>\r\n<p style=\"text-align: justify;\"><strong>1. Componente curricular: Matem&aacute;tica (Base Nacional Comum - Ensino M&eacute;dio)</strong></p>\r\n<p style=\"text-align: justify;\">Candidato(s) Aprovado(s)</p>\r\n<p style=\"text-align: justify; padding-left: 60px;\">-Licenciado</p>\r\n<p style=\"text-align: justify; padding-left: 60px;\">N&ordm; de Inscri&ccedil;&atilde;o/ Nome/ RG/ Nota/ Classifica&ccedil;&atilde;o Final</p>\r\n<p style=\"text-align: justify; padding-left: 60px;\">011/ Thiago Henrique Santos Viana/ 43.209.011-3/ 64,33/ 1&ordm;</p>\r\n<p style=\"text-align: justify; padding-left: 60px;\">Candidato(s) Ausente(s)</p>\r\n<p style=\"text-align: justify; padding-left: 60px;\">N&deg; de Inscri&ccedil;&atilde;o/ RG</p>\r\n<p style=\"text-align: justify; padding-left: 60px;\">012/ 15.294.389/4</p>\r\n<p style=\"text-align: justify; padding-left: 60px;\">&nbsp;</p>\r\n<p style=\"text-align: justify; padding-left: 60px;\">015/ 8.633.313-6</p>\r\n<p style=\"text-align: justify; padding-left: 60px;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\"><strong>4. Componente Curricular: Matem&aacute;tica (Base Nacional Comum - Inform&aacute;tica Integrado ao Ensino M&eacute;dio)</strong></p>\r\n<p style=\"