(15, '2016-09-13', 'Edital de LicitaÃ§Ã£o n Âº 002/2016', '<p>A professora Ros&acirc;ngela Badine Pizzighini, Diretora Executiva da APM da ETEC de Lins, sito &agrave; Rua S&atilde;o Pedro, 300, Vila Perin - Lins/SP, torna p&uacute;blica a abertura da licita&ccedil;&atilde;o na modalidade \"CONVITE, do tipo MAIOR OFERTA\", em conformidade com as exig&ecirc;ncias estabelecidas neste edital e respectivos anexos, bem como a Lei Federal n &ordm; 8666, de 21 de junho de 1993. O Edital completo estar&aacute; dispon&iacute;vel aos interessados na ETEC de Lins a partir do dia 13/09/2016 at&eacute; o dia 25/09/2016 das 08h00min &agrave;s 12h00min e das 13h00min &agrave;s 17h00min e das 19h00min &agrave;s 21h00min de segunda a sexta-feira. assim como no site: http:// www.eteclins.com.br</p>\r\n<br>\r\n<a href=\"arquivos/publicacao/Docucolor252713.pdf\" target=\"_blank\">Clique aqui para ver o Edital</a>', 1),
