(18, '2016-10-11', 'Processo Seletivo de Docentes 148/05/2016 - URGENTE* - Comunicado de AlteraÃ§Ã£o da Data da Aula Tes', '<p><strong>ETEC DE LINS, Lins</strong></p>\r\n<p><strong>PROCESSO SELETIVO DE DOCENTES, NOS TERMOS DO COMUNICADO CEETEPS N&deg; 1/2009, E SUAS ALTERA&Ccedil;&Otilde;ES.</strong></p>\r\n<p><strong>AVISO N&deg; 148/05/2016 de 05/09/2016. Processo n&deg; 6142/2016</strong></p>\r\n<p><strong>AVISO DE ALTERA&Ccedil;&Atilde;O DA DATA DA AULA TESTE.</strong></p>\r\n<p>O Diretor de Escola T&eacute;cnica da ETEC DE LINS comunica que, por motivo de for&ccedil;a maior, ficam alterados a data e hor&aacute;rio das aulas teste dos Processo Seletivo de Docentes&nbsp;nos componentes curriculares abaixo listados:</p>\r\n<p><strong>4. Componente curricular: Hist&oacute;ria (Base Nacional Comum - Ensino M&eacute;dio).</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Data.</p>\r\n<p>de 13/10/2016 Hor&aacute;rio 11h30min</p>\r\n<p>para 20/10/2016 Hor&aacute;rio 11h30min</p>\r\n<p>&nbsp;</p>\r\n<p><strong>11. Componente curricular: Desenvolvimento e Design de Websites III (Inform&aacute;tica para Internet).</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Data.</p>\r\n<p>de 18/10/2016 Hor&aacute;rio 15h</p>\r\n<p>para 25/10/2016 Hor&aacute;rio 16h</p>\r\n<p>&nbsp;</p>\r\n<p><strong>12. Componente curricular: Projeto de Aplica&ccedil;&otilde;es Web II (Inform&aacute;tica para Internet).</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Data.</p>\r\n<p>de 18/10/2016 Hor&aacute;rio 16h</p>\r\n<p>para 25/10/2016 Hor&aacute;rio 17h</p>\r\n<p>&nbsp;</p>\r\n<p><strong>18. Componente curricular: Qu&iacute;mica dos Pol&iacute;meros (Qu&iacute;mica).</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Data.</p>\r\n<p>de 17/10/2016 Hor&aacute;rio 08h</p>\r\n<p>para 07/11/2016 Hor&aacute;rio 08h</p>\r\n<p>&nbsp;</p>\r\n<p><strong>As aulas teste dos demais componentes curriculares continuam nas mesmas datas e hor&aacute;rios divulgados no site eteclins.cps.sp.gov.br em 30/09/2016.</strong></p>', 1),
(19, '2016-10-13', 'Concurso PÃºblico Docente - Etec de AraÃ§atuba - Resultado Final', '<p><strong>ETEC DE ARA&Ccedil;ATUBA &ndash; ARA&Ccedil;ATUBA</strong></p>\r\n<p><strong>CLASSE DESCENTRALIZADA EE VITOR ANTONIO TRINDADE</strong></p>\r\n<p><strong>CONCURSO P&Uacute;BLICO DE PROFESSOR DE ENSINO M&Eacute;DIO E T&Eacute;CNICO &ndash; EDITAL N&ordm; 165/03/2016 &ndash; PROCESSO N&ordm; 3749/2016</strong></p>\r\n<p><strong>AUTORIZA&Ccedil;&Atilde;O GOVERNAMENTAL:</strong></p>\r\n<p><strong>DESPACHO PUBLICADO NO DOE DE 26/05/2015, SE&Ccedil;&Atilde;O I, P&Aacute;GINA 1 &ndash; PROCESSO N&ordm; 5.976/2014 (SGP-10.908-15)</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>EDITAL DE RESULTADO DA PROVA DE M&Eacute;TODOS PEDAG&Oacute;GICOS, PROVA DE T&Iacute;TULOS E CLASSIFICA&Ccedil;&Atilde;O FINAL.</strong></p>\r\n<p>A Comiss&atilde;o Especial de Concurso P&uacute;blico da ETEC DE LINS, comunica aos candidatos abaixo relacionados o resultado da Prova de M&eacute;todos Pedag&oacute;gicos, Prova de T&iacute;tulos e a classifica&ccedil;&atilde;o final.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>&ndash; COMPONENTE CURRICULAR: GERENCIAMENTO DE ROTINAS ADMINISTRATIVAS</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>CANDIDATO(S) APROVADO(S):</strong></p>\r\n<p><strong>LICENCIADO</strong></p>\r\n<p>N&ordm; de Insc./Nome ou Nome Social/D.I. &ndash; Tipo/CPF/Nota da Prova de M&eacute;todos Pedag&oacute;gicos/Pontua&ccedil;&atilde;o na Prova de T&iacute;tulos/Nota Final/Classifica&ccedil;&atilde;o Final.</p>\r\n<p>008/Maria Aparecida Alves Barbosa de Medeiros/13.028.512-2 - RG/023.541.688-61/72,33/0,00/72,33/1&ordm;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>GRADUADO</strong></p>\r\n<p>N&ordm; de Insc./Nome ou Nome Social/D.I. &ndash; Tipo/CPF/Nota da Prova de M&eacute;todos Pedag&oacute;gicos/Pontua&ccedil;&atilde;o na Prova de T&iacute;tulos/Nota Final/Classifica&ccedil;&atilde;o Final.</p>\r\n<p>007/Diana Yumi Tanaka Hagui/ 28.230.372-8 - RG/ 296.037.238-78/73,00/0,00/73,00/1&ordm;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>CANDIDATO(S) N&Atilde;O APROVADO(S)</strong></p>\r\n<p>N&ordm; de Inscri&ccedil;&atilde;o/D.I. &ndash; Tipo/CPF/ Nota da Prova de M&eacute;todos Pedag&oacute;gicos.</p>\r\n<p>001/ 14.836.321-0 - RG/ 039.295.568-71/ 45,33</p>\r\n<p>002/ 8.099.639 - CNH/ 958.722.808-15/ 34,33</p>\r\n<p>006/ 20.648.355-7 - RG/ 117.223.448-57/ 43,00</p>\r\n<p>&nbsp;</p>\r\n<p><strong>CANDIDATO(S) AUSENTE(S)</strong></p>\r\n<p>N&ordm; de Inscri&ccedil;&atilde;o/D.I. &ndash; Tipo/CPF</p>\r\n<p>005/ 33.925.081-1 - RG/ 216.941.018-00</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Publicado no Di&aacute;rio Oficial do Estado de S&atilde;o Paulo de 11/10/2016, Caderno Executivo I, p&aacute;gina 227.</strong></p>', 1),
