(21, '2017-01-03', 'Aviso de Abertura de InscriÃ§Ãµes ao Processo Seletivo de Docentes', '<p>Est&atilde;o abertas, de 02/01/2017 a 16/01/2017, as inscri&ccedil;&otilde;es ao processo seletivo de docentes, para forma&ccedil;&atilde;o de cadastro de reserva, aviso de abertura de inscri&ccedil;&otilde;es 148/06/2016, de 28/12/2016.<br />As disciplinas s&atilde;o nas &aacute;reas de inform&aacute;tica e matem&aacute;tica.</p>\r\n<p>Informa&ccedil;&otilde;es pelo telefone 14 3523-1217 Ramal 203, e pelo e-mail e148op@cps.sp.gov.br</p>', 1),
(23, '2017-01-17', 'Aviso de deferimento e indeferimento de inscriÃ§Ãµes e convocaÃ§Ã£o para aula teste', '<p>ETEC DE LINS, Lins</p>\r\n<p>PROCESSO SELETIVO DE DOCENTES, NOS TERMOS DO COMUNICADO CEETEPS N&deg; 1/2009, E SUAS ALTERA&Ccedil;&Otilde;ES.</p>\r\n<p>AVISO N&deg; 148/06/2016 de 28/12/2016. Processo n&deg; 316/2017</p>\r\n<p>AVISO DE DEFERIMENTO E INDEFERIMENTO DE INSCRI&Ccedil;&Otilde;ES E CONVOCA&Ccedil;&Atilde;O PARA AULA TESTE.</p>\r\n<p>O Diretor de Escola T&eacute;cnica da ETEC DE LINS faz saber aos candidatos abaixo relacionados o deferimento e indeferimento das inscri&ccedil;&otilde;es e convoca para AULA TESTE, a ser realizada na ETEC DE LINS, sita na Rua S&atilde;o Pedro, 300, Vila Perin.</p>\r\n<p>Conforme disposto no item 9 do inciso III do Comunicado CEETEPS n&deg; 1/2009, publicado no DOE de 31.01.2009, alterado pelo Comunicado CEETEPS n&ordm; 5/2009, o candidato convocado, entregar&aacute; uma c&oacute;pia do diploma frente/ verso, na aus&ecirc;ncia, c&oacute;pia da certid&atilde;o de conclus&atilde;o de curso ou certificado/declara&ccedil;&atilde;o de conclus&atilde;o da forma&ccedil;&atilde;o superior registrada na ficha de inscri&ccedil;&atilde;o. Os candidatos convocados observar&atilde;o, tamb&eacute;m, as al&iacute;neas b e c do subitem 3.2 do inciso IV e o item 7 do inciso V dos Comunicados mencionados anteriormente.</p>\r\n<p>1. Componente curricular: Manuten&ccedil;&atilde;o de Perif&eacute;ricos I.</p>\r\n<p>Inscri&ccedil;&atilde;o(&otilde;es) Deferida(s)</p>\r\n<p>N&deg; de Inscri&ccedil;&atilde;o/ Nome/ RG</p>\r\n<p>004/ Jairo Miriel Antonucci/ 47.923.502-8</p>\r\n<p>005/ Thiago Galdim Bergamaschi/ 1.421.758-MS</p>\r\n<p>006/ Alessandro Silva Rodrigues/ 42.634.347-5</p>\r\n<p>Rela&ccedil;&atilde;o dos 03(tr&ecirc;s) temas para AULA &ndash; TESTE</p>\r\n<p>1 Diferen&ccedil;as entre impressoras a jato de tinta e laser.</p>\r\n<p>2 Energia est&aacute;tica: t&eacute;cnicas de preven&ccedil;&atilde;o contra descargas eletrost&aacute;ticas.</p>\r\n<p>3 Manuten&ccedil;&atilde;o preventiva e corretiva. Principais diferen&ccedil;as.</p>\r\n<p>Dura&ccedil;&atilde;o m&aacute;xima da aula: 15 minutos</p>\r\n<p>Data. 23/01/2017 Hor&aacute;rio 10h</p>\r\n<p>&nbsp;</p>\r\n<p>2. Componente curricular: Fundamentos da Matem&aacute;tica Financeira.</p>\r\n<p>Inscri&ccedil;&atilde;o(&otilde;es) Deferida(s)</p>\r\n<p>N&deg; de Inscri&ccedil;&atilde;o/ Nome/ RG</p>\r\n<p>001/ Rogerio Rodrigues dos Santos/ 45.347.541-3</p>\r\n<p>002/ Thiago Henrique Santos Viana/ 43.209.011-3</p>\r\n<p>003/ Ros&acirc;ngela Peregrina Sanches/ 42.017.111-3</p>\r\n<p>Rela&ccedil;&atilde;o dos 03(tr&ecirc;s) temas para AULA &ndash; TESTE</p>\r\n<p>1 C&aacute;lculos trabalhistas.</p>\r\n<p>2 Sistema de Amortiza&ccedil;&atilde;o Constante (SAC).</p>\r\n<p>3 Sistema Franc&ecirc;s (Tabela Price).</p>\r\n<p>Dura&ccedil;&atilde;o m&aacute;xima da aula: 15 minutos</p>\r\n<p>Data. 23/01/2017 Hor&aacute;rio 11h</p>', 1),
