(53, '2017-05-24', 'Concurso para Professor 148 04 2017 Resultado da Prova Escrita', '<p style=\"box-sizing: inherit; color: rgba(0, 0, 0, 0.87); font-family: Roboto, sans-serif; font-size: 15px; text-align: justify;\">Em anexo a esta publica&ccedil;&atilde;o o resultado da prova escrita e convoca&ccedil;&atilde;o para a prova de m&eacute;todos pedag&oacute;gicos, concurso para professor 148/04/2017, componente curricular Enfermagem em Sa&uacute;de Mental.</p>\r\n<p style=\"box-sizing: inherit; color: rgba(0, 0, 0, 0.87); font-family: Roboto, sans-serif; font-size: 15px; text-align: justify;\">O mesmo foi publicado no Di&aacute;rio Oficial do Estado de S&atilde;o Paulo, na edi&ccedil;&atilde;o de hoje, caderno Executivo I, p&aacute;gina 154.<br style=\"box-sizing: inherit;\" /><br style=\"box-sizing: inherit;\" />Os prazos e procedimentos para interposi&ccedil;&atilde;o de recursos, se for o caso, constam no cap&iacute;tulo XIII do Edital de Abertura de Inscri&ccedil;&otilde;es publicado em 28/03/2017, caderno executivo I, paginas 195 a 197.</p>', 1),
(54, '2017-05-24', 'Concurso para Professor 148 05 2017 Resultado da Prova Escrita', '<p style=\"box-sizing: inherit; color: rgba(0, 0, 0, 0.87); font-family: Roboto, sans-serif; font-size: 15px; text-align: justify;\">Em anexo a esta publica&ccedil;&atilde;o o resultado da prova escrita e convoca&ccedil;&atilde;o para a prova de m&eacute;todos pedag&oacute;gicos, concurso para professor 148/05/2017, componente curricular Tecnologia dos Materiais Inorg&acirc;nicos II.</p>\r\n<p style=\"box-sizing: inherit; color: rgba(0, 0, 0, 0.87); font-family: Roboto, sans-serif; font-size: 15px; text-align: justify;\">O mesmo foi publicado no Di&aacute;rio Oficial do Estado de S&atilde;o Paulo, na edi&ccedil;&atilde;o de hoje, caderno Executivo I, p&aacute;gina 154.<br style=\"box-sizing: inherit;\" /><br style=\"box-sizing: inherit;\" />Os prazos e procedimentos para interposi&ccedil;&atilde;o de recursos, se for o caso, constam no cap&iacute;tulo XIII do Edital de Abertura de Inscri&ccedil;&otilde;es publicado em 28/03/2017, caderno executivo I, paginas 197 a 200.</p>', 1),
