(57, '2017-06-09', 'Concurso para Professor 148 01 2017 Resultado Final', ' Em anexo a esta publicação o resultado da prova de métodos pedagógicos, prova de títulos e classificação final, concurso para professor 148/01/2017, componente curricular Estudo do Solo e Materiais na Construção Civil.\r\nO mesmo foi publicado no Diário Oficial do Estado de São Paulo, na edição de hoje (08/06/2017), caderno Executivo I, página 193.\r\nOs prazos e procedimentos para interposição de recursos, se for o caso, constam no capítulo XIII do Edital de Abertura de Inscrições publicado em 28/03/2017, caderno executivo I, paginas 205 a 207.\r\n<br>\r\n<br>\r\n<a href=\"arquivos/publicacao/resultadofinal.pdf\" target=\"_blank\">Resultado Final</a><br>\r\n<a href=\"arquivos/publicacao/resultadodoe.pdf\" target=\"_blank\">Resultado Final DOE</a>', 1),
(58, '2017-06-23', 'Concurso para Professor 148 02 2017 Resultado Final', '<p>\r\nEm anexo a esta publicação o resultado da prova de métodos pedagógicos, prova de títulos e classificação final, concurso para professor 148/02/2017, componente curricular Desenho Básico Aplicado à Construção Civil.\r\n</p>\r\n<p>\r\nO mesmo foi publicado no Diário Oficial do Estado de São Paulo, na edição de hoje (23/06/2017), caderno Executivo I, página 175.\r\n</p>\r\n<p>\r\nOs prazos e procedimentos para interposição de recursos, se for o caso, constam no capítulo XIII do Edital de Abertura de Inscrições publicado em 28/03/2017, caderno executivo I, paginas 191 a 193.\r\n</p>\r\n<a href=\"arquivos/publicacao/148-02-2017ResultadoFinalDOE.pdf\" target=\"_blank\">Resultado Final DOE</a><br>\r\n<a href=\"arquivos/publicacao/148-02-2017ResultadoFinal.pdf\" target=\"_blank\">Resultado Final</a>', 1),
(59, '2017-06-23', 'Concurso para Professor 148 07 2017 Resultado da Prova Escrita', '<p>Em anexo a esta publicação o resultado da prova escrita e convocação para a prova de métodos pedagógicos, concurso para professor 148/07/2017, componente curricular Enfermagem em Centro Cirúrgico e Central de Material.</p>\r\n<p>O mesmo foi publicado no Diário Oficial do Estado de São Paulo, na edição de hoje, caderno Executivo I, páginas 178.</p>\r\n<p>Os prazos e procedimentos para interposição de recursos, se for o caso, constam no capítulo XIII do Edital de Abertura de Inscrições publicado em 20/04/2017, caderno executivo I, paginas 179 a 181.</p>\r\n<a href=\"arquivos/publicacao/ConvocacaoProvaPedagogica-Enfermagem.pdf\" target=\"_blank\">Edital de Resultado da Prova Escrita e Convocação para a Prova de Métodos Pedagógicos DOE</a><br>\r\n<a href=\"arquivos/publicacao/ConvocacaoProvaPedagogicaDOE-Enfermagem.pdf\" target=\"_blank\">Edital de Resultado da Prova Escrita e Convocação para a Prova de Métodos Pedagógicos DOE</a>', 1),
(60, '2017-06-26', 'Concurso para Professor 148 03 2017 Resultado Final', '<p>\r\nEm anexo a esta publicação o resultado da prova de métodos pedagógicos, prova de títulos e classificação final, concurso para professor 148/03/2017, componente curricular Primeiros Socorros.\r\n</p>\r\n<p>\r\nO mesmo foi publicado no Diário Oficial do Estado de São Paulo, na edição de sábado (24/06/2017), caderno Executivo I, página 228.\r\n</p>\r\n<p>\r\nOs prazos e procedimentos para interposição de recursos, se for o caso, constam no capítulo XIII do Edital de Abertura de Inscrições publicado em 28/03/2017, caderno executivo I, paginas 193 a 195.\r\n</p>\r\n<a href=\"arquivos/publicacao/148-03-2017-ResultadoFinalDOE.pdf\" target=\"_blank\">Resultado Final DOE</a><br>\r\n<a href=\"arquivos/publicacao/148-03-2017-ResultadoFinal.pdf\" target=\"_blank\">Resultado Final</a>', 1),
(61, '2017-06-26', 'Concurso para Professor 148 04 2017 Resultado Final', '<p>\r\nEm anexo a esta publicação o resultado da prova de métodos pedagógicos, prova de títulos e classificação final, concurso para professor 148/04/2017, componente curricular Enfermagem em Saúde Mental.\r\n</p>\r\n<p>\r\nO mesmo foi publicado no Diário Oficial do Estado de São Paulo, na edição de sábado (24/06/2017), caderno Executivo I, página 229.\r\n</p>\r\n<p>\r\nOs prazos e procedimentos para interposição de recursos, se for o caso, constam no capítulo XIII do Edital de Abertura de Inscrições publicado em 28/03/2017, caderno executivo I, paginas 195 a 197.\r\n</p>\r\n<a href=\"arquivos/publicacao/148-04-2017-ResultadoFinalDOE.pdf\" target=\"_blank\">Resultado Final DOE</a><br>\r\n<a href=\"arquivos/publicacao/148-04-2017-ResultadoFinal.pdf\" target=\"_blank\">Resultado Final</a>', 1),
(62, '2017-06-26', 'Concurso para Professor 148 05 2017 Resultado Final', '<p>\r\nEm anexo a esta publicação o resultado da prova de métodos pedagógicos, prova de títulos e classificação final, concurso para professor 148/05/2017, componente curricular Tecnologia dos Materiais Inorgânicos II.\r\n</p>\r\n<p>\r\nO mesmo foi publicado no Diário Oficial do Estado de São Paulo, na edição de sábado (24/06/2017), caderno Executivo I, página 229.\r\n</p>\r\n<p>\r\nOs prazos e procedimentos para interposição de recursos, se for o caso, constam no capítulo XIII do Edital de Abertura de Inscrições publicado em 28/03/2017, caderno executivo I, paginas 197 a 200.\r\n</p>\r\n<a href=\"arquivos/publicacao/148-05-2017-ResultadoFinalDOE.pdf\" target=\"_blank\">Resultado Final DOE</a><br>\r\n<a href=\"arquivos/publicacao/148-05-2017-ResultadoFinal.pdf\" target=\"_blank\">Resultado Final</a>', 1),
(63, '2017-06-27', 'Concurso para Professor 148 06 2017 Resultado Final', '<p>\r\nEm anexo a esta publicação o resultado da prova de métodos pedagógicos, prova de títulos e classificação final, concurso para professor 148/06/2017, componente curricular Análise de Processos Físico-Químicos II.\r\n</p>\r\n<p>\r\nO mesmo foi publicado no Diário Oficial do Estado de São Paulo, na edição de hoje (27/06/2017), caderno Executivo I, página 272.\r\n</p>\r\n<p>\r\nOs prazos e procedimentos para interposição de recursos, se for o caso, constam no capítulo XIII do Edital de Abertura de Inscrições publicado em 28/03/2017, caderno executivo I, paginas 201 a 203.\r\n</p>\r\n<a href=\"arquivos/publicacao/148-06-2017-ResultadoFinalDOE.pdf\" target=\"_blank\">Resultado Final DOE</a><br>\r\n<a href=\"arquivos/publicacao/148-06-2017-ResultadoFinal.pdf\" target=\"_blank\">Resultado Final</a>', 1),
(64, '2017-07-03', 'Processo Seletivo para Docentes 148 01 2017 Abertura de Inscrições', '<p>\r\n Aviso de Abertura de Inscrições ao Processo Seletivo de Docentes 148/01/2017, objetivando formação de cadastro de reserva de professores nas disciplinas constantes do mesmo, publicado no Diário Oficial de Sábado (01/07/2017), caderno Executivo I, página 181.\r\n</p>\r\n<p>\r\nAs inscrições serão de 10/07 a 24/07, no horário das 09h às 12h e das 14h às 17h.\r\n</p>\r\n<p>\r\nO requisito de titulação exigido para cada componente curricular pode ser acessado no site www.cpscetec.com.br/crt.\r\n</p>\r\n<a href=\"arquivos/publicacao/148-01-2017-AvisodeAberturadeInscricoesDOE.pdf\" target=\"_blank\">Abertura de Inscrições DOE</a><br>\r\n<a href=\"arquivos/publicacao/148-01-2017-AvisodeAberturadeInscricoes.pdf\" target=\"_blank\">Abertura de Inscrições</a>', 1);
