(65, '2017-07-11', 'Concurso para Professor 148 07 2017 Resultado Final', '<p>\r\nEm anexo a esta publicação o resultado da prova de métodos pedagógicos, prova de títulos e classificação final, concurso para professor 148/07/2017, componente curricular Enfermagem em Centro Cirúrgico e Central de Material.\r\n</p>\r\n<p>\r\nO mesmo foi publicado no Diário Oficial do Estado de São Paulo, na edição de hoje (11/07/2017), caderno Executivo I, página 151.\r\n</p>\r\n<p>\r\nOs prazos e procedimentos para interposição de recursos, se for o caso, constam no capítulo XIII do Edital de Abertura de Inscrições publicado em 20/04/2017, caderno executivo I, paginas 179 a 181.\r\n</p>\r\n<a href=\"arquivos/publicacao/148-07-2017-ResultadoFinalDOE.pdf\" target=\"_blank\">Resultado Final DOE</a><br>\r\n<a href=\"arquivos/publicacao/148-07-2017-ResultadoFinal.pdf\" target=\"_blank\">Resultado Final</a>', 1),
(66, '2017-08-07', 'Convocação para Aula Teste - Processo Seletivo para Docentes 148/01/2017.', '<p>\r\nO Diretor de Escola Técnica da ETEC DE LINS faz saber aos candidatos abaixo relacionados o deferimento e indeferimento das inscrições e convoca para AULA TESTE, a ser realizada na ETEC DE LINS, sita na Rua São Pedro, 300, Vila Perin.\r\n</p>\r\n<p>\r\nConforme disposto no item 9 do inciso III do Comunicado CEETEPS n° 1/2009, publicado no DOE de 31.01.2009, alterado pelo Comunicado CEETEPS nº 5/2009, o candidato convocado, entregará uma cópia do diploma frente/ verso, na ausência, cópia da certidão de conclusão de curso ou certificado/declaração de conclusão da formação superior registrada na ficha de inscrição. Os candidatos convocados observarão, também, as alíneas b e c do subitem 3.2 do inciso IV e o item 7 do inciso V dos Comunicados mencionados anteriormente.\r\n</p>\r\n\r\n<a href=\"arquivos/publicacao/148-01-2017-DeferimentoAulaTeste-DOE1.pdf\" target=\"_blank\">[1] Deferimento Aula Teste DOE</a><br>\r\n<a href=\"arquivos/publicacao/148-01-2017-DeferimentoAulaTeste-DOE2.pdf\" target=\"_blank\">[2] Deferimento Aula Teste DOE</a><br>\r\n<a href=\"arquivos/publicacao/148-01-2017DeferimentoAulaTeste-PS.pdf\" target=\"_blank\">Deferimento Aula Teste</a>', 1),
(67, '2017-09-27', 'Abertura de Inscrições ao Processo Seletivo de Docentes', '<center>\r\n        <b>ESCOLA TÉCNICA ESTADUAL DE LINS - LINS</b>\r\n    </center>\r\n    <p>\r\n        <b>\r\n      AVISO DE ABERTURA DE INSCRIÇÕES AO PROCESSO SELETIVO DE DOCENTES, OBJETIVANDO A FORMAÇÃO DE CADASTRO PARA CONTRATAÇÃO TEMPORÁRIA DE EXCEPCIONAL INTERESSE PÚBLICO, Nº 148/02/2017 DE 25/09/2017.\r\n    </b>\r\n    </p>\r\n    <p>\r\n        O Diretor da <b>ESCOLA TÉCNICA ESTADUAL DE LINS</b>, da cidade de LINS, com fundamento no Comunicado CEETEPS-1, de 30.01.2009, publicado no DOE de 31.01.2009, com alterações introduzidas pelos Comunicados CEETEPS nos 3, 5/2009, 2/2010, e 2/2011,\r\n        faz saber que encontram-se abertas as inscrições aos Processos Seletivos para a formação de cadastro de docentes, nos componentes curriculares a seguir discriminados:\r\n    </p>\r\n    <p>\r\n        <b>COMPONENTE(S) CURRICULAR(ES) (CURSO E/OU HABILITAÇÃO):</b>\r\n    </p>\r\n    <p>\r\n        1 - Estruturas na Construção Civil(Edificações);<br> 2 - Projetos de Instalações Prediais(Edificações);<br> 3 - Física (Base Nacional Comum/ ETIM)(Ensino Medio - BNC / PD );<br> 4 - Língua Estrangeira Moderna - Inglês (Base Nacional Comum/ ETIM)(Ensino\r\n        Medio - BNC / PD );<br> 5 - Língua Portuguesa e Literatura (Base Nacional Comum/ ETIM)(Ensino Medio - BNC / PD );<br> 6 - Geografia (Base Nacional Comum/ ETIM)(Ensino Medio - BNC / PD );<br> 7 - Instalação para Computadores I (Manutenção e Suporte\r\n        em Informática);<br> 8 - Manutenção de Periféricos I(Manutenção e Suporte em Informática);<br> 9 - Análise de Riscos(Segurança do Trabalho);<br> 10 - Programas Aplicados em Saúde e Segurança do Trabalho(Segurança do Trabalho)\r\n    </p>\r\n    <p>\r\n        <b>I - Período, local de inscrições e valor da hora aula.</b>\r\n    </p>\r\n    <p>\r\n        <b>1.</b> As inscrições serão recebidas no período de 02/10/2017 à 16/10/2017 no horário das 14H00 ÀS 17H00 E DAS 19H30 ÀS 21H00.\r\n        <br>\r\n        <b>1.1.</b> Não haverá atendimento aos sábados, domingos, feriados e pontos facultativos, apesar desses dias serem computados no prazo.\r\n    </p>\r\n    <p>\r\n        <b>2.</b> Local de inscrições - <b>ESCOLA TÉCNICA ESTADUAL DE LINS</b> <br>Endereço: <b>RUA SÃO PEDRO,300</b><br> Bairro: <b>VILA PERIN</b><br> Cidade: <b>LINS</b><br> Telefone: <b>14 3523 1217</b><br> e-mail: <b>E148OP@CPS.SP.GOV.BR</b><br>\r\n        <b>WWW.ETECLINS.COM.BR</b>\r\n    </p>\r\n    <p>\r\n        <b>3.</b> O valor da hora-aula prestada é de R$ 17,15 (dezessete reais e quinze centavos), correspondente a Professor de Ensino Médio e Técnico.\r\n    </p>\r\n    <p>\r\n        <b>II - Requisitos de titulação</b>\r\n    </p>\r\n    <p>\r\n        Os requisitos de qualificação dos profissionais de cada componente(s) curricular(es) estão estabelecidos pelo Catálogo de Requisitos de Titulação, e se encontra(m) divulgado(s) nas dependências da ETEC.\r\n    </p>\r\n    <p>\r\n        <b>III - As regras do processo seletivo encontram-se nos Comunicados CEETEPS acima citados.</b>\r\n    </p>\r\n    <p>\r\n        <b>IV - O Aviso supra, os Comunicados CEETEPS nºs 1, 3, 5/2009, 2/2010, e 2/2011, e a Deliberação CEETEPS-2/2009 de 28.01.2009, divulgada no DOE de 29.01.2009, encontram-se afixados nas dependências da ETEC.</b>\r\n    </p>', 1),
(68, '2017-10-24', 'Processo Seletivo 148.02.2017, convocação para Aula Teste', '<p>\r\nEm anexo Aviso de Deferimento/Indeferimento de inscrições e Convocação para Aula Teste, que foi publicado no Diário Oficial de hoje (31/10/2017), Caderno Executivo I, páginas 246 e 247.\r\n</p>\r\n<a href=\"arquivos/publicacao/148-02-2017DeferimentoAulaTeste-PS.pdf\" target=\"_blank\">Deferimento para Aula Teste</a><br>', 1),
(69, '2017-11-27', 'Processo Seletivo 148.02.2017, Resultado da Aula Teste', '<p>\r\nEm anexo Aviso de Resultado da Aula Teste e Classificação Final, que foi publicado no Diário Oficial de Sábado (25/11/2017), Poder Executivo – Seção I – Página 200.\r\n</p>\r\n<a href=\"arquivos/publicacao/148-02-2017ResultadoAulaTestePSDOE.pdf\" target=\"_blank\">Resultado da Aula Teste DOE</a><br>\r\n<a href=\"arquivos/publicacao/148-02-2017ResultadoAulaTeste-PS.pdf\" target=\"_blank\">Resultado da Aula Teste</a><br>', 0),
(70, '2017-11-27', 'Processo Seletivo 148.02.2017, Resultado da Aula Teste', '<p>\r\nEm anexo Aviso de Resultado da Aula Teste e Classificação Final, que foi publicado no Diário Oficial de Sábado (25/11/2017), Poder Executivo – Seção I – Página 200.\r\n</p>\r\n<a href=\"arquivos/publicacao/148-02-2017ResultadoAulaTestePSDOE\" target=\"_blank\">Resultado da Aula Teste DOE</a><br>\r\n<a href=\"arquivos/publicacao/148-02-2017ResultadoAulaTeste-PS\" target=\"_blank\">Resultado da Aula Teste</a><br>', 1),
(73, '2018-03-01', 'Processo Seletivo para Docentes 148/01/2018 Convocação para Aula Teste (Informática)', '<p>\r\nFoi publicado hoje no Diário Oficial do Estado de São Paulo, Edição de hoje (01/03/2018), Seção I, página 203, o Aviso de Deferimento/Indeferimento de Inscrições e Convocação para Aula Teste do Processo Seletivo 148/01/2018 – Informática. <br>\r\n\r\nEm anexo os temas, datas e horários referentes a cada componente curricular.\r\n</p>\r\n\r\n<a href=\"arquivos/publicacao/148-01-2018DeferimentoAulaTeste-PS.pdf\" target=\"_blank\">Convocação para Aula Teste</a><br>\r\n<a href=\"arquivos/publicacao/148-01-2018DeferimentoAulaTeste-PSDOE.pdf\" target=\"_blank\">Convocação para Aula Teste - DOE</a><br>', 1),
(72, '2018-02-08', 'Processo seletivo para docentes nas áreas de informática e química.', '<p>\r\nEstarão abertas, no período de 09/02/2018 a 23/02/2018, as inscrições ao Processo Seletivo para Docentes da Etec de Lins, Aviso de Abertura de Inscrições 148/01/2018 e 148/02/2018. <br>\r\n\r\nOs procedimentos, horários e local para as inscrições estão nos arquivos em anexo\r\n</p>\r\n<a href=\"arquivos/publicacao/148-01-2018-AvisodeAberturadeInscricoes.pdf\" target=\"_blank\">Aviso de Abertura de Inscrições do Processo para Professores de Informática</a><br>\r\n<a href=\"arquivos/publicacao/148-02-2018-AvisodeAberturadeInscricoes.pdf\" target=\"_blank\">Aviso de Abertura de Inscrições do Processo para Professores de Química</a><br>\r\n<a href=\"arquivos/publicacao/DeliberacaoCeeteps02-2009.pdf\" target=\"_blank\">Deliberação Ceeteps 2009 02-2009</a><br>\r\n<a href=\"arquivos/publicacao/ComunicadoCEETEPS01-2009comalteracoes.pdf\" target=\"_blank\">Comunicado Ceeteps 02-2009</a><br>', 1),
(74, '2018-03-01', 'Processo Seletivo para Docentes 148/02/2018 Convocação para Aula Teste (Química)', '<p>\r\nFoi publicado hoje no Diário Oficial do Estado de São Paulo, Edição de hoje (01/03/2018), Seção I, páginas 203 e 204, o Aviso de Deferimento/Indeferimento de Inscrições e Convocação para Aula Teste do Processo Seletivo 148/02/2018 – Química.<br>\r\n\r\nEm anexo os temas, datas e horários referentes a cada componente curricular.\r\n</p>\r\n\r\n<a href=\"arquivos/publicacao/148-02-2018DeferimentoAula TestePS.pdf\" target=\"_blank\">Convocação para Aula Teste</a><br>\r\n<a href=\"arquivos/publicacao/148-02-2018DeferimentoAulaTeste-PSDOEp203.pdf\" target=\"_blank\">Convocação para Aula Teste - DOE pág. 203</a><br>\r\n<a href=\"arquivos/publicacao/148-02-2018DeferimentoAulaTeste-PSDOEp204.pdf\" target=\"_blank\">Convocação para Aula Teste - DOE pág. 204</a><br>', 1),
